var nodes = !context.panel.data.series[0].fields ? [] : JSON.parse(context.panel.data.series[0].fields[2].values[0]);
var edges = !context.panel.data.series[0].fields ? [] : JSON.parse(context.panel.data.series[0].fields[1].values[0]);
var categories = !context.panel.data.series[0].fields ? [] : JSON.parse(context.panel.data.series[0].fields[0].values[0]);

data = {
  nodes: nodes, //JSON.parse(context.panel.data.series[0].fields[2].values[0]),
  edges: edges,
  categories: categories,
};


return {
  title: {
    text: '',
    subtext: '',
    top: 'top',
    left: 'left'
  },
  tooltip: {
    trigger: 'item',
    //show: true,
    //formatter: (params) => '<div>' + 'subnet: ' + params.data.subnet + '</div>' + '<div>' + 'vnet: ' + params.data.vnet + '</div>',
    //valueFormatter: (params) => '<div>' + params.data.src_to_dest_data_size + '</div>'
  },
  animationDurationUpdate: 100,
  animationEasingUpdate: 'linear',
  legend: [
    {
      data: [
        {
          name: 'InterVNet',
          itemStyle: {
            color: '#00FFFF'
          }
        },
        {
          name: 'IntraVNet',
          itemStyle: {
            color: '#AAAA90'
          }
        },
        {
          name: 'AzurePublic',
          itemStyle: {
            color: '#FFB76B'
          }
        },
        {
          name: 'ExternalPublic',
          itemStyle: {
            color: '#F7D1D8'
          }
        },
        {
          name: 'UnknownPrivate',
          itemStyle: {
            color: '#D6F6D5'
          }
        },
        {
          name: 'Unknown',
          itemStyle: {
            color: '#FFE6EE'
          }
        },
        {
          name: 'S2S',
          itemStyle: {
            color: '#228B22'
          }
        },
        {
          name: 'P2S',
          itemStyle: {
            color: '#93E9BE'
          }
        },
        {
          name: 'MaliciousFlow',
          itemStyle: {
            color: '#FF2400'
          }
        }
      ],
      position: 'right',
      orient: 'vertical',
      right: 10,
      top: 20,
      bottom: 20
    }
  ],
  series: [
    {
      name: 'Node Name',
      type: 'graph',
      layout: 'force',
      data: data.nodes.map(n => ({
        ...n,
        borderType: 'solid',
        borderWidth: 2,
        symbolSize: [50, 50],
        itemStyle: {
          borderType: 'solid',
          borderWidth: 2,
          color: n.category == 'AzurePublic' ? '#FFB76B' :
            n.category == 'IntraVNet' ? '#AAAA90' :
              n.category == 'InterVNet' ? '#00FFFF' :
                n.category == 'ExternalPublic' ? '#F7D1D8' :
                  n.category == 'UnknownPrivate' ? '#D6F6D5' :
                    n.category == 'Unknown' ? '#FFE6EE' :
                      n.category == 'S2S' ? '#228B22' :
                        n.category == 'P2S' ? '#93E9BE' :
                          n.category == 'MaliciousFlow' ? '#FF2400' : '#FFFFFF',
        },
        tooltip: {
          formatter: function (params) {

            var subnet = ((params.data.subnet != '') ? `<div>subnet:&nbsp${params.data.subnet}</div>` : '');
            var vnet = ((params.data.vnet != '') ? `<div>vnet:&nbsp${params.data.vnet}</div>` : '');
            var subscription = ((params.data.subscription) ? `<div>subscription:&nbsp${params.data.subscription}</div>` : '');
            var rg = ((params.data.rg) ? `<div>rg:&nbsp${params.data.rg}</div>` : '');
            var azPublicPIPLocation = ((params.data.azurePublicPIPLocation) ? `<div>Azure location:&nbsp${params.data.azurePublicPIPLocation}</div>` : '');
            var externalPublicPIPLocation = ((params.data.externalPublicCountry) ? `<div>Internet location:&nbsp${params.data.externalPublicCountry}</div>` : '');

            //malicious Src url, threat type and desc
            var maliciousSrcPIPUrl = ((params.data.maliciousSrcPIPUrl) ? `<div>malicious src url:&nbsp${params.data.maliciousSrcPIPUrl}</div>` : '');

            var maliciousSrcPipThreatType = ((params.data.maliciousSrcPipThreatType) ? `<div>malicious src threat type:&nbsp${params.data.maliciousSrcPipThreatType}</div>` : '');


            var maliciousSrcPIPThreatDescription = ((params.data.maliciousSrcPIPThreatDescription) ? `<div>malicious src threat desc:&nbsp${params.data.maliciousSrcPIPThreatDescription}</div>` : '');

            //malicious Dest url, threat type and desc
            var maliciousDestPIPUrl = ((params.data.maliciousDestPIPUrl) ? `<div>malicious dest url:&nbsp${params.data.maliciousDestPIPUrl}</div>` : '');

            var maliciousDestPIPThreatType = ((params.data.maliciousDestPIPThreatType) ? `<div>malicious dest threat type:&nbsp${params.data.maliciousDestPIPThreatType}</div>` : '');

            var maliciousDestPIPThreatDescription = ((params.data.maliciousDestPIPThreatDescription) ? `<div>malicious dest threat desc:&nbsp${params.data.maliciousDestPIPThreatDescription}</div>` : '');

            return subnet + vnet + subscription + rg + azPublicPIPLocation + externalPublicPIPLocation + maliciousSrcPIPUrl + maliciousSrcPipThreatType + maliciousSrcPIPThreatDescription + maliciousDestPIPUrl + maliciousDestPIPThreatType + maliciousDestPIPThreatDescription;
          }
        },

        symbol: n.nodeType == 'APPGW' ? 'image://data:image/png;base64,' :
          n.nodeType == 'ALB' ? 'image://data:image/png;base64,' :
            n.nodeType == 'PAAS' ? 'image://data:image/png;base64,' :
              n.nodeType == 'BASTION' ? 'image://data:image/png;base64,' :
                n.nodeType == 'PRIVATEENDPOINT' ? 'image://data:image/png;base64,' :
                  n.nodeType == 'INTERNET' ? 'image://data:image/png;base64,' :
                    n.nodeType == 'NODE' ? 'image://data:image/png;base64,' :
                      n.nodeType == 'MALICIOUSFLOW' ? 'image://data:image/png;base64,' :
                        n.nodeType == 'EXTERNALPUBLICMALICIOUS' ? 'image://data:image/png;base64,' :
                          n.nodeType == 'UNKNOWN' ? 'image://data:image/png;base64,' :
                            'circle'




      })),


      links: data.edges.map(n => ({
        ...n,
        tooltip: {
          formatter: function (params) {
            var timeGenerated = ((params.data.estTimeOfTraffic) ? `<div>est. time of traffic:&nbsp${params.data.estTimeOfTraffic}</div>` : '');
            var dataSize = `${params.data.source}&nbsp&nbsp ${params.data.src_to_dest_data_size} &nbsp->&nbsp<-&nbsp ${params.data.dest_to_srct_data_size} ${params.data.target}`;
            var flowType = `<div>flow type:&nbsp ${params.data.flowType}</div>`;
            var protocol = ((params.data.protocol), `<div>protocol:&nbsp ${params.data.protocol}<div>`, '');
            var connectionType = ((params.data.connectionType), `<div>connection type:&nbsp ${params.data.connectionType}<div>`, '');
            var nsg = ((params.data.nsg) ? `<div>NSG:&nbsp${params.data.nsg}</div>` : '');
            var nsgRule = ((params.data.nsgRule) ? `<div>NSG Rule:&nbsp${params.data.nsgRule}</div>` : '');
            var isUDRHop = ((params.data.isUDRHop) ? `<div>is udr routed:&nbsp${params.data.isUDRHop}</div>` : '');

            var flowDirection = ((params.data.flowDirection) ? `<div>direction:&nbsp${params.data.flowDirection}</div>` : '');

            var noOfRequests = ((params.data.numberOfRequests) ? `<div>total calls:&nbsp${params.data.numberOfRequests}</div>` : '');

            var estAvgDurationSec = ((params.data.estAvgDurationSec) ? `<div>first-last observed diff sec:&nbsp${params.data.estAvgDurationSec}</div>` : '');

            var flowStartTime = ((params.data.flowStartTime) ? `<div>first observed at:&nbsp${params.data.flowStartTime}</div>` : '');

            var flowEndTime = ((params.data.flowEndTime) ? `<div>last observed at:&nbsp${params.data.flowEndTime}</div>` : '');

            return timeGenerated + dataSize + flowType + protocol + flowDirection + connectionType + nsg + nsgRule + isUDRHop + noOfRequests + estAvgDurationSec + flowStartTime + flowEndTime;
          }
        },

        lineStyle: {
          color: n.category == 'AzurePublic' ? '#FFB76B' :
            n.category == 'IntraVNet' ? '#AAAA90' :
              n.category == 'InterVNet' ? '#00FFFF' :
                n.category == 'ExternalPublic' ? '#F7D1D8' :
                  n.category == 'UnknownPrivate' ? '#D6F6D5' :
                    n.category == 'Unknown' ? '#FFE6EE' :
                      n.category == 'S2S' ? '#228B22' :
                        n.category == 'P2S' ? '#93E9BE' :
                          n.category == 'MaliciousFlow' ? '#FF2400' : '#FFFFFF'

        },
      })),
      categories: data.categories,//categories, //graphData.categories,

      force: {

        edgeLength: 8,
        repulsion: 80000,
        gravity: 0.1,
        friction: 1,
        layoutAnimation: context.grafana.replaceVariables("${enable_graph_animation}")?.toLowerCase?.() === 'true'
      },


      edgeSymbol: ['none', 'arrow'],
      animation: false,
      roam: true,
      draggable: true,
      zoom: 0.2,

      label: {
        show: true,
        formatter: (params) => params.data.name + '\n' + params.data.ip,
        position: 'right',
        fontSize: 12
      },


      symbolSize: 30,

      lineStyle: {
        color: '#FFFFFF',
        width: 1,
        opacity: 1,
        curveness: 0.2
      },
      emphasis: {
        focus: 'adjacency',
        lineStyle: {
          width: 4
        }
      },
      edgeSymbol: ['none', 'arrow'],
      edgeSymbolSize: [2, 9],

    }
  ]
};